import React, { useState } from 'react';

const MenuIcon = () => (
  <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
    <line x1="3" y1="12" x2="21" y2="12"></line>
    <line x1="3" y1="6" x2="21" y2="6"></line>
    <line x1="3" y1="18" x2="21" y2="18"></line>
  </svg>
);

const CloseIcon = () => (
  <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
    <line x1="18" y1="6" x2="6" y2="18"></line>
    <line x1="6" y1="6" x2="18" y2="18"></line>
  </svg>
);

const Header = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  const navItems = [
    { label: 'About', href: '#about' },
    { label: 'Features', href: '#features' },
    { label: 'Customers', href: '#customers' },
    { label: 'Updates', href: '#updates' },
    { label: 'Help', href: '#help' }
  ];

  const partners = [
    'Acme Corp',
    'Quantum',
    'Echo Valley',
    'Celestial',
    'PULSE',
    'APEX'
  ];

  return (
    <div className="min-h-screen bg-gradient-to-b from-blue-50 to-blue-500">
      {/* Navigation */}
      <nav className="p-4">
        <div className="max-w-7xl mx-auto flex justify-between items-center">
          {/* Logo */}
          <div className="flex items-center">
            <div className="w-8 h-8 rounded-full bg-orange-500 flex items-center justify-center">
              <span className="text-white text-xl">☺</span>
            </div>
            <span className="ml-2 text-xl font-semibold">joyful</span>
          </div>

          {/* Desktop Navigation */}
          <div className="hidden md:flex items-center space-x-6">
            {navItems.map((item) => (
              <a
                key={item.label}
                href={item.href}
                className="text-gray-700 hover:text-gray-900"
              >
                {item.label}
              </a>
            ))}
            <button className="bg-black text-white px-4 py-2 rounded-md">
              Get for free
            </button>
          </div>

          {/* Mobile Menu Button */}
          <button
            className="md:hidden"
            onClick={() => setIsMenuOpen(!isMenuOpen)}
          >
            {isMenuOpen ? <CloseIcon /> : <MenuIcon />}
          </button>
        </div>

        {/* Mobile Navigation */}
        {isMenuOpen && (
          <div className="md:hidden absolute top-16 left-0 right-0 bg-white shadow-lg">
            {navItems.map((item) => (
              <a
                key={item.label}
                href={item.href}
                className="block px-4 py-2 text-gray-700 hover:bg-gray-100"
              >
                {item.label}
              </a>
            ))}
            <div className="p-4">
              <button className="w-full bg-black text-white px-4 py-2 rounded-md">
                Get for free
              </button>
            </div>
          </div>
        )}
      </nav>

      {/* Hero Section */}
      <main className="max-w-7xl mx-auto px-4 py-12">
        <div className="flex flex-col md:flex-row items-center">
          <div className="md:w-1/2">
            <div className="text-sm mb-4">Version 2.0 is here</div>
            <h1 className="text-4xl md:text-6xl font-bold mb-6">
              Pathway to productivity
            </h1>
            <p className="text-lg mb-8">
              Celebrate the joy of accomplishment with an app designed to track
              your progress, motivate your efforts, and celebrate your successes.
            </p>
            <div className="space-x-4">
              <button className="bg-black text-white px-6 py-3 rounded-md">
                Get for free
              </button>
              <button className="text-black hover:underline">
                Learn more →
              </button>
            </div>
          </div>

          <div className="md:w-1/2 mt-8 md:mt-0">
            {/* Placeholder for the mechanical flower image */}
            <div className="w-full aspect-square bg-gradient-to-r from-blue-400 to-blue-600 rounded-full" />
          </div>
        </div>
      </main>

      {/* Partners Section */}
      <div className="max-w-7xl mx-auto px-4 py-12">
        <div className="flex flex-wrap justify-center items-center gap-8 opacity-50">
          {partners.map((partner) => (
            <div
              key={partner}
              className="text-gray-600 text-sm font-medium"
            >
              {partner}
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Header;
